import React from "react";
import Coverr from "../../img/bg-lang.png";

const Lang = () => {
  return (
    <div
      className="back"
      style={{
        backgroundImage: `url(${Coverr})`,
        height: "100vh",
        marginTop: "-70px",
        fontSize: "50px",
        backgroundSize: "cover",
        backgroundRepeat: "no-repeat",
      }}
    >
      <h1>Hello</h1>
    </div>
  );
};

export default Lang;
